package com.example.auta.domain.entities;import com.example.auta.models.enums.ReservationStatus;import com.fasterxml.jackson.annotation.JsonIgnoreProperties;import lombok.*;import org.hibernate.annotations.GenericGenerator;import javax.persistence.*;import java.math.BigDecimal;import java.time.LocalDate;import java.util.UUID;@Entity@Data@NoArgsConstructor@Builder@AllArgsConstructorpublic class ReservationEntity {    @Id    @GeneratedValue(generator = "uuid")    @GenericGenerator(name = "uuid", strategy = "org.hibernate.id.UUIDGenerator")    private UUID id;    private LocalDate reservationDate;    @ManyToOne    @EqualsAndHashCode.Exclude @ToString.Exclude    @JsonIgnoreProperties("reservations")    private CustomerEntity customer;    @OneToOne    private CarEntity car = new CarEntity();    private LocalDate rentalStartDate;    private LocalDate rentalEndDate;    @ManyToOne    private BranchEntity rentalBranch;    @ManyToOne    private BranchEntity returnBranch;    private BigDecimal totalPrice;    private ReservationStatus reservationStatus;}